  const json5 = require('json5');
  const {TbArrowMoveLeft, TbArrowMoveRight } =require('react-icons/tb');
  const { useDebounceCallback } = require('@react-hook/debounce');
  const { useColorModeValue, useColorMode } = require('@chakra-ui/react');

  const getSymbol = (link) => link?.inByType[deep.idLocal('@deep-foundation/core', 'Symbol')]?.[0]?.value?.value

  const getTypes = (link) => {
    const types = [];
    for (let l = link; l?.type && l?.id !== 1; l = link?.type) types.push(link?.type_id);
    return types;
  };

  const ListItem = ({ link, current, setCurrent, ...props }) => {
    // const [__symbol] = deep.useMinilinksSubscription({
    //   type_id: deep.idLocal('@deep-foundation/core', 'Symbol'),
    //   to_id: { _in: getTypes(link) },
    // });
    // const _symbol = __symbol?.value?.value;
    const _symbol = getSymbol(link) || getSymbol(link?.type) || getSymbol(link?.type?.type);
    const _value = deep.stringify(link?.value?.value);
    const __value = _value?.length > 29 ? _value.slice(0, 20)+'...'+_value.slice(-9, _value.length) : _value;
    return (<Box background='backgroundModal' p='0.2rem' {...props}>
      <Box mr='0.5rem'><Text>{_symbol} {link?.id} {deep.nameLocal(link?.id)}</Text></Box>
      <Box mr='0.5rem'><Text>{__value}</Text></Box>
      <Flex 
        divider={<StackDivider borderColor='borderColor' />}
        spacing={2}
        justifyContent='space-between'
        alignItems='center'
        sx={{
          '& > *:not(:last-of-type)': {
            mr: '0.5rem'
          }
        }}
      >
        {!!link?.from_id && <Button 
          size='sm'
          variant="outline" 
          width='max-content'
          rightIcon={<TbArrowMoveLeft size='1.3rem' />}
            onClick={async () => {
            const { data: [next] } = await deep.select(link?.from_id);
            setCurrent(next);
          }}
        ><Text fontSize='sm'>{link?.from_id || 0}</Text></Button>}
        {!!link?.to_id && <Button 
          size='sm'
          fontSize='sm'
          variant="outline"
          leftIcon={<TbArrowMoveRight size='1.3rem' />} 
            onClick={async () => {
            const { data: [next] } = await deep.select(link?.to_id);
            setCurrent(next);
          }}
        ><Text>{link?.to_id || 0}</Text></Button>}
        {!!link?.type_id && <Button
          size='sm' 
          fontSize='sm'
          variant="outline" 
            onClick={async () => {
            const { data: [next] } = await deep.select(link?.type_id);
            setCurrent(next);
          }}
        ><Text>{link?.type_id} {deep.nameLocal(link?.type_id)}</Text></Button>}
      </Flex>
    </Box>);
  };

  const List = ({
    link, parentsQuery, childrenQuery, current, setCurrent
  }) => {
    const { data: parents } = deep.useDeepSubscription(parentsQuery);

    const { data: children } = deep.useDeepSubscription(childrenQuery);

    const descriptionQuery = React.useMemo(() => {
      return {
        to: { down: {
          tree_id: deep.idLocal('@deep-foundation/core', 'typesTree'),
          link_id: { _in: [
            ...(current?.id ? [current.id] : []),
            ...parents?.map(l => l.id),
            ...children?.map(l => l.id),
            ...parents?.map(l => l.from_id),
            ...children?.map(l => l.from_id),
            ...parents?.map(l => l.to_id),
            ...children?.map(l => l.to_id),
          ] },
         } },
        type_id: { _in: [deep.idLocal('@deep-foundation/core', 'Contain'), deep.idLocal('@deep-foundation/core', 'Symbol')] },
      };
    }, [current, parents, children]);
    const description = deep.useDeepSubscription(descriptionQuery);

    deep.useDeepSubscription({
      down: {
        tree_id: deep.idLocal('@deep-foundation/core', 'typesTree'),
        link_id: { _in: [
          ...(current?.id ? [current.id] : []),
          ...parents?.map(l => l.id),
          ...children?.map(l => l.id),
          ...parents?.map(l => l.from_id),
          ...children?.map(l => l.from_id),
          ...parents?.map(l => l.to_id),
          ...children?.map(l => l.to_id),
