    const [mode, setMode] = React.useState(typeof(search) === 'string' ? 'Search' : typeof(query) === 'object' ? 'Query' : 'Contains');
    const [ viewSize, setViewSize ] = React.useState({ height: 400, width: 450 });

    React.useEffect(() => onChange && onChange(current), [current]);

    const [trees, setTrees] = React.useState([]);
    React.useEffect(() => { mode === 'Trees' && (async () => {
      setTrees((await deep.select({
        link_id: { _eq: current?.id },
        parent_id: { _eq: current?.id }
        distinct_on: ['tree_id'],
      }, {
        table: 'tree',
        returning: `
          id link_id tree_id root_id depth position_id
        `,
      }))?.data);
    })() }, [mode, current]);
    const [tree, setTree] = React.useState();
    React.useEffect(() => setTree(), [mode, current]);

    const [q, setQ] = React.useState(query);
    const setQoDebounce = useDebounceCallback((q) => {
      try {
        setQo(json5.parse(q));
      } catch(error) {}
    }, 1000);
    const [qo setQo] = React.useState(q);

    const [s, setS] = React.useState(search || '');
    const setSoDebounce = useDebounceCallback((s) => {
      const num = parseFloat(s);
      const _or = [];
      if (!Number.isNaN(num)) {
        _or.push({ id: num }, { number: { value: num } });
      }
      _or.push(
        { string: { value: s } },
        { string: { value: { _ilike: s } } },
        { string: { value: { _similar: s } } },
        { in: { type_id: deep.idLocal('@deep-foundation/core', 'Contain'), string: { value: s } } },
        { in: { type_id: deep.idLocal('@deep-foundation/core', 'Contain'), string: { value: { _ilike: s } } } },
        { in: { type_id: deep.idLocal('@deep-foundation/core', 'Contain'), string: { value: { _similar: s } } } },
      );


      const query = JSON.stringify({
        _or,
      });
      setQ(query);
      // setQoDebounce(query);
      try {
        setQo(json5.parse(query));
      } catch(error) {}
    }, 1000);

    const { colorMode } = useColorMode();

    const bg = useColorModeValue('#eeeeee', '#434343');
    const hover = useColorModeValue('white', '#1e1e1e');
