        <Button variant='solid' size='sm' background={!(mode === 'Query') ? 'backgroundModal' : 'gray.400'} borderColor={!(mode === 'Query') ? 'borderColor' : 'backgroundModal'} borderWidth='thin' onClick={() => setMode('Query')}>ðŸ”</Button>
        <Button variant='solid' size='sm' background={!(mode === 'Contains') ? 'backgroundModal' : 'gray.400'} borderColor={!(mode === 'Contains') ? 'borderColor' : 'backgroundModal'} borderWidth='thin' onClick={() => setMode('Contains')}>ðŸ—‚</Button>
        <Button variant='solid' size='sm' background={!(mode === 'In/Out') ? 'backgroundModal' : 'gray.400'} borderColor={!(mode === 'In/Out') ? 'borderColor' : 'backgroundModal'} borderWidth='thin' onClick={() => setMode('In/Out')}>In/Out</Button>
