              { up: {
                tree_id: tree?.tree_id,
                root_id: tree?.root_id,
                parent_id: tree?.link_id,
                depth: tree?.depth,
              } },
              { down: {
                tree_id: tree?.tree_id,
                root_id: tree?.root_id,
                depth: tree?.depth + 1,
              } },
            ]}}
          />]}
        </>}
      </>}
      {children}
    </div>

    return <>
      {fillSize 
      ? body 
      : <Resize
          onChangeSize={(viewSize) => setViewSize(viewSize)} 
          style={{
          // position: 'relative',
          // overflow: nested ? 'hidden' : 'inherit',
          borderRadius: 5,
          border: 'none',
        }}
      >{body}</Resize>}
    </>;
  };
}
